// @mui material components

// import SuiTypography from "components/SuiTypography";
// import { Link } from 'react-router-dom';
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";

import { Table } from 'react-bootstrap';


function Sidemenu() {
    return (
        <DashboardLayout>
            <DashboardNavbar />

            <br />
            <Table striped bordered hover size="sm" style={{ textAlign: "center", borderColor: 'black' }}>

                <tbody>
                    <tr>

                        <td>My APP Title</td>

                        <td>Gumption Labs Finserv</td>

                    </tr>

                    <tr>
                        <th>Google Play Store URL for my APP</th>
                        <td>https://fundexpert.page.link/ARN-13974</td>
                    </tr>
                </tbody>
            </Table>

            <button type="button" style={{width: 'webkitFillAvailable'}} className="collapsible">MY BANK DETAILS FOR MY MONTHLY PAYOUTS<i className="fa fa-caret-down fa-2x" style={{position: 'absolute' ,right: '2%'}}>-</i></button>

            <Footer />
        </DashboardLayout>
    );
}

export default Sidemenu;
